Hello Neighbours,&nbsp;

I am reaching&nbsp;out to our wonderful community asking for help in keeping the costs down for CANDLE PAINTING and TERRARIUM workshops I am hosting.&nbsp; &nbsp;I've included a list below of some of the supplies we will need and I am happy to come pick them up at your earliest convenience.&nbsp;

CANDLE PAINTING:&nbsp; I&nbsp;am looking for LOTS of candles.&nbsp; In addition to unused pillar or taper candles (any colour) to paint on, used candles of any kind or any colour are needed as well to use as the 'paint' in this project.&nbsp; If you have any spare small paint brushes, that would also be very helpful.&nbsp;

TERRARIUMS: I need&nbsp;to collect some 'cool' glass containers.&nbsp; These could be vases, decanters, a giant Nutella jar etc...lids or no lids, both will work.&nbsp; If you have any leftover small gravel or pumice stones that can be used as our substrate, that would also be helpful.&nbsp; For the gravel, this needs to be small, and of any colour similar to the colorful stones you can get for your aquarium.&nbsp; Last but not least plants.&nbsp; We're doing two types of eco systems, tropical and arid.&nbsp; If you have any spare succulents, cactus, spider plants, or any plants that are quick to propagate, we can give them their very own new ecosystem.&nbsp;

Thank you in&nbsp;advance for your help.&nbsp; When responding to the message, please let me know roughly where you live and when would be a convenient time for me to pick the items up.&nbsp;&nbsp;

THANK YOU!!!

